import './Galeria.css';

const Galeria = () =>{
    return(
        <div className='galeria'>
        {adatok.map((adat) => (
        <Kartya
            key={adat.id}
            cim={adat.cim}
            kep={adat.kep}
            leiras={adat.leiras}
        />
    ))}
    </div>
    );
};

export default Galeria;
